    vis = [False] * len(S)
    for i in range(len(S)):
        if S[i] == W[0] and (not vis[i]):
            vis[i] = True
            j = i + 1
            k = 1
            while j < len(S) and k < len(W):
                if S[j] == W[k] and (not vis[j]):
                    vis[j] = True
                    k += 2
                j += 1
            if k == len(W):
                ans += 1
            else:
                break
    return ans

